export default function Ents(state = [], action) {
   console.log("Entry reducing action " + action.type);
   switch (action.type) {
      case 'GET_ENTS':
         return action.ents;
      case 'ADD_ENT':
         return state.concat([action.ent]);
      case 'DEL_CNV':
         console.log(state.filter(curCnv => curCnv.id !== action.cnv))
         return state.filter(curCnv => curCnv.id !== action.cnv)
      default:
         return state;
   }
}
